// import React from 'react';
// import logo from './logo.svg';
// import './App.css';
import { Routes, Route} from "react-router-dom"
import { Container } from 'react-bootstrap'
// import { Login } from "./pages/Login"
import Login from "./pages/Login"
import SetNick from "./pages/SetNick"
import Main from "./pages/Profile"


function App() {

  return <Container>
    <Routes>
      <Route path="/" element={<Login />} />
      <Route path="/setnick" element={<SetNick />} />
      <Route path="/profile" element={<Main />} />
      <Route path="/profile/chat" element={<Chat />} />
      <Route path="/profile/game" element={<Main />} />
      {/* <Route path="/profile/game" element={<Game />} /> */}
    </Routes>
  </Container>
}

export default App;
